import React from "react";
import { useParams } from 'react-router-dom';

import { ContainerPage, TittlePage } from "../../components/Main";

const Page = () => {
    // Obter o parâmetro 'data' da URL
    const { data } = useParams();

    return (
        <ContainerPage>
            <TittlePage>
                <div className="wc-text">Ótimo!<br /> Agora nos informe em que nível você se encontra em cada técnologia selecionada</div>
            </TittlePage>

            {/* Exibir os dados recebidos */}
            <div>
                <h1>Dados Nivelamento</h1>
                <p>Dados selecionados: {data}</p>
            </div>
        </ContainerPage>
    );
}

export default Page;
